import React from 'react'

const buttonStyle = {
    width: document.getElementById("choice").style.width/2 - 5,
    height: "50px",
    padding: "10px",
    margin: "5px"
}

const button = (props) => {
  return (
    <button style={buttonStyle}>{props.title}</button>
  )
}

export default button
